import React, { useContext, useEffect } from "react";
import { observer } from "mobx-react";

import EditIcon from "@material-ui/icons/Edit";
import AddIcon from "@material-ui/icons/Add";
import SettingsIcon from '@material-ui/icons/Settings';
import SpeedDial, { SpeedDialProps } from '@material-ui/lab/SpeedDial';
import SpeedDialIcon from '@material-ui/lab/SpeedDialIcon';
import SpeedDialAction from '@material-ui/lab/SpeedDialAction';
import { Button, List, ListItem, ListItemText } from "@material-ui/core";

import { StoreTechnologiesContext } from "../../../store/technology";
import SectionComponent from "../Section";
import styled from "styled-components";
import SpeedDialComponent from "../../global/SpeedDial";

const SpeedDialStyled = styled(SpeedDial)`
  position: absolute;
  right: 5px;
  top: 10px;
  >button{
    width: 40px;
    height: 40px;
  }
`;

const Technologies: React.FC = observer(() => {
  const technologiesStore = useContext(StoreTechnologiesContext);
  const { technologies, fetch, add } = technologiesStore;

  useEffect(() => {
    fetch();
  }, [fetch]);

  const actions = [
    { icon: <AddIcon />, name: "Add" },
    { icon: <EditIcon />, name: "Edit" },
  ];

  const [open, setOpen] = React.useState(false);

  const handleClose = () => {
    setOpen(false);
  };

  const handleOpen = () => {
    setOpen(true);
  };

  return (
    <SectionComponent title={"Technologies"}>
      <List>
        {technologies.map((tech) => (
          <ListItem key={tech.id}>
            <ListItemText primary={tech.name} />
          </ListItem>
        ))}
      </List>
        <SpeedDialComponent actions={actions} />
    </SectionComponent>
  );
});

export default Technologies;
